import React from "react";

import { Helmet } from "react-helmet";
const Error404 = () => {
  return (
    <div>
      <Helmet>
        <title>404 PAGE NOT FOUND</title>
      </Helmet>
      <section className="height_video_fullscreen text-center background_menu background_responsive p-0">
        <div className="position-relative w-100 z_index_1 padding_x_high height_video_fullscreen backgroud_dark_opacity">
          <span className="font_family_span font_color_span mb-5 font_weight_boldest head_size_high">
            404
          </span>
          <p className="font_color_link_onlight head_size_low">
            Page not found
          </p>
          <p className="font_color_link_onlight head_size_low">
            Oops! The page you are looking for does not exist. It might have
            been moved or deleted.
          </p>
        </div>
      </section>
    </div>
  );
};

export default Error404;
